pragma solidity ^0.8.20;

contract Fund {
    mapping(address => uint256) public funded;
    uint256 minValue = 1 * 10 ** 18;

    function fund() public payable {
        require(msg.value >= minValue, "send more Eth");
        funded[msg.sender] = msg.value;
    }
}

